// Import the required modules
const express = require('express');
const bodyParser = require('body-parser');
const multer = require('multer');
const sharp = require('sharp');

// Create a new Express application
const app = express();

// Use the body-parser middleware to parse the request body
app.use(bodyParser.urlencoded({ extended: true }));
app.use(bodyParser.json());

// Define the storage for the uploaded files
const storage = multer.diskStorage({
  // Destination folder for the uploaded files
  destination: './uploads',
  // File name for the uploaded file
  filename: (req, file, cb) => {
    cb(null, file.originalname);
  }
});

// Create a new Multer instance with the defined storage
const upload = multer({ storage });

// Define the GET route for serving the index.html file
app.get('/', (req, res) => {
  // Send the index.html file as the response
  res.sendFile(__dirname + '/index.html');
});

// Define the POST route for handling the image upload
app.post('/upload', upload.single('file'), async (req, res) => {
  try {
    // Get the uploaded file from the request
    const { file } = req;
    const { originalname, buffer } = file;

    // Resize the image using Sharp
    await sharp(buffer)
      .resize({ width: 500, height: 500 }) // Resize to a specified width and height
      .toFormat('jpeg') // Convert to JPEG format
      .toFile(`./uploads/${originalname}`); // Save the resized image to disk

    // Send a success message as the response
    res.send(`The image ${originalname} has been resized and saved to ./uploads/`);
  } catch (error) {
    // Handle any errors that occur during the upload process
    console.error(error);
    res.status(500).send('Error uploading image');
  }
});

// Start the server on a specified port
const PORT = process.env.PORT || 3000;
app.listen(PORT, () => {
  console.log(`Server running on port ${PORT}`);
});
